/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`mm_cpsc502101team04`@`%` PROCEDURE `check_out_book`(
IN user_num int, IN book_num varchar(30))
BEGIN
	IF NOT EXISTS
		(SELECT *
        FROM USERS
        WHERE USERS.user_id = user_num)
	THEN
		SELECT 'Error: Library user not found.' AS output;
	
    ELSE
		IF NOT EXISTS 
			(SELECT *
			FROM BOOKS
			WHERE BOOKS.ISBN = book_num)
		THEN 
			SELECT 'Error: Book not found.' AS output;
		ELSE
			IF (
				SELECT num_copies
				FROM BOOKS
				WHERE BOOKS.ISBN = book_num) <= 0
			THEN
				SELECT 'Error: Not enough copies.' AS output;
		
			ELSE INSERT INTO BOOKS_CHECK_OUT
				VALUES(user_num, book_num, DATE_ADD(NOW(), INTERVAL 60 DAY), NOW(), NULL);
            
				SELECT concat((
					SELECT book_title
					FROM BOOKS
					WHERE BOOKS.ISBN = book_num),
                    ' has been checked out to ', 
                    (SELECT first_name
                    FROM USERS
                    WHERE USERS.user_id = user_num))
                    AS 'Book checked out:';
			END IF;
		END IF;
	END IF;
END ;;
DELIMITER ;
